import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the "Sort and Filter Controls" container by label text
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Wait for the List View button using its icon (FontAwesome "fa-list") and aria-label
    // Try to find the button by icon class and title attribute
    const listBtn = await page.waitForSelector('button.view-btn[title="List View"]', { timeout: 5000 });

    // Take screenshot before switching
    const step2 = path.join(screenshotsDir, 'step_2_before_switch.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the List View button
    await listBtn.click();

    // Wait for the products-list container to appear (list view mode)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching
    const step3 = path.join(screenshotsDir, 'step_3_list_view.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract a sample of product titles in list view to verify
    const productTitles = await page.$$eval('.products-list .product-title', nodes =>
      nodes.slice(0, 5).map(n => n.textContent.trim())
    );

    // Check if the List View button now has the 'active' class
    const isListActive = await page.$eval('button.view-btn[title="List View"]', btn =>
      btn.classList.contains('active')
    );

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        listViewActive: isListActive,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
